(12, 1, '2017-03-31 01:46:06', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'MJ塞車通(APP)', '明郅資訊科技的塞車通APP，將高工局的即時資料整理統計後，以簡便的顯示方式讓您一目瞭然，看到目前塞車的路段及已塞車的時間避開壅塞，提前更改預設路線，讓您 總是比別人早一步到達目的地。', 'http://www.mj-app.com.tw/Trafficjam/index.html', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(21, 2, '2017-03-31 09:03:40', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '電流行為管理分析系統', '<p>節能省電是近年非常發燒的話提，我們藉著和國內知名大學自行開發的監控系統整合，讓系所透過省電策略管理一年可省下30%以上的電費，本系統目前開發至第二皆段，若有軟硬體整合需求可與我們聯絡</p>', 'http://www.mj-app.com.tw/Electric/index.html', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(24, 3, '2017-03-31 01:46:06', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '儀器場地租賃系統', '自動化租賃預約系統，24小時隨時隨地皆可預約，客製化系統設定、簡易管理介面、彈性設定，不但可節省人力資源，更可分析瀏覽紀錄來追蹤您的訪客，讓您能針對客戶族群做潛在開發。', '#', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(25, 4, '2017-11-14 03:22:39', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '法院公告刊登系統', '<p>無論您在何時身在何地，均可以輕鬆方便的取得線上報價。除了法院廣告刊登以外，亦提供了線上刷卡或銀行轉帳收費串接，讓您以最便利的方式完成公告刊登</p>', 'http://app.sly-ha.com.tw/', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(26, 5, '2017-11-14 06:01:12', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '法務案件管理系統(BETA)', '印象中律師總是繁忙的，不是在開庭就是在查找證物..等，資料一堆堆，法務系統讓你有效管理資料，還可設定提醒功能，出庭、補件時間絕不忘。', '#', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(27, 6, '2017-11-14 06:02:02', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '詠興法律事務所(企業官網)', '<p>以超越專業的技術，給你最好的建議與更完善的法律保障，提供全方位法律業務，網站等同於企業的門面，針對產業性質和文化，建立良好的網頁設計形象。</p>', 'http://us.mj-app.com.tw/', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(28, 7, '2017-11-14 06:05:17', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '成大財信管理顧問(企業官網)', '<p>強制執行業務數位化，讓客人透過網站了解強制執行的流程，並可直接透過網站線上委託交辦，不論是查封、指界 、鑑價..等其他執行委託項目、利用完善的網站功能， 提升服務效率。　</p>', 'http://www.ts-ad.tw/', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(29, 8, '2017-11-14 06:06:33', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '蕾舒翠美妝官網', '<p>L''Herboflore蕾舒翠人氣精品面膜品牌，響應式網頁(RWD)，以桃紅色風格為主軸，以明亮乾淨為基礎，簡單的介面設計讓顧客消費無障礙。</p>', 'http://www.bestone.com.tw/', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(30, 9, '2017-11-14 06:07:16', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '17 Photo 一起拍', '『自拍棒』是這一年來最熱門的拍照道具。因為自拍棒的盛行，導致很多公共場合擔心打擾到其他人，因此開始有禁用自拍棒的趨勢。拍不出職業級的美照，路人拍出來的照片總是&hellip;令人失望，該上哪拍出美照呢?!', '#', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(31, 10, '2017-11-14 06:07:50', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '倉儲管理系統(進行中)', '家中是否有閒置空間？家中是否東西堆滿堆？明郅的歐爸倉儲方案可以完整解決您的問題，讓你家也可以輕鬆擁有一個任意門，只要一指，空間雜物通通幫你解決。', '#', 'Y');
INSERT INTO `product` (`id`, `Porder`, `Create_Time`, `Cover0`, `Cover1`, `Pname`, `Content`, `Url`, `Status`) VALUES
(32, 11, '2017-11-14 06:10:42', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', '開心農場(募資中)', '台灣以農立國，在幾十年工商化發展後，最近又興起一股在地化，接觸土壤這個大地之母的聲音。透過APP整合，我們準備讓真實的開心農場化為實際。', '#', 'Y');

