INSERT INTO `team` (`id`, `Porder`, `create_time`, `title`, `subtitle`, `Cover0`, `Content`, `Status`) VALUES
(1, 1, '2018-03-06 01:33:04', 'HAHA', '程式部', 'data:image/jpeg;base64,', '因為一場意外墜落在地球，古靈精怪長講冷笑話，常常說出別人無法理解的話。不但電腦功力深厚，還有著尚未激發的特異功能。對地球上的事物充滿好奇，決定找份工作留下來在地球定居。', 'Y'),
(2, 2, '2018-03-01 02:14:07', '仔仔猴', '程式部', 'data:image/jpeg;base64,', '上知天文下知地理，任何問題總能輕鬆幫你解決，除了上班以外，不輕易踏出門，電子用品是他最好的朋友，ptt是他最佳交友好去處，擁有廣大鄉民的支助，即使沒買過蘋果商品也能靠著高IQ撰寫APP。', 'Y'),
(3, 3, '2018-03-01 02:14:11', '勇醬', '程式部', 'data:image/jpeg;base64,', '個性雞婆，非常愛管事，做任何事總是衝第一，愛作夢，對未來抱著很大的夢想，嚮往能擁有像超級英雄般的能力，能夠打擊罪犯，是個標準的正義魔人，路見不平絕對會爬刀相助，絕不向惡勢力低頭。', 'Y'),
(4, 4, '2018-03-01 02:14:15', '胖達', '設計部', 'data:image/jpeg;base64,', '一隻極為樂天派的貓熊，雖然非常貪吃，但很任勞任怨言聽計從，一說謊就臉紅的乖孩子音樂總是放得很大聲，似乎有點重聽傾向，但總能隨著音樂搖擺並揮霍著畫筆，大放藝術才華。', 'Y'),
(5, 5, '2018-03-01 02:14:20', '小歪', '行銷部', 'data:image/jpeg;base64,', '看似溫柔可人，卻愛調皮搗蛋，每到下午茶時段就開始狂嗑甜食；有顆善良的心，看到可憐之事必發揮十秒落淚之絕佳好演技。誤路歧途走上行銷之路，期望當個可靠的女強人，賺大錢孝順父母。', 'Y'),
(6, 6, '2018-03-01 02:14:28', '掰兔', '業務部主管', 'data:image/jpeg;base64,', '外表看似柔弱，事實上卻超級聰明狡猾，嘴上功夫非常了得，總能把黑的說成白，做錯事裝無辜的功力也是一流；南北奔波，練就一身瞬間移動的功夫，夢想是在下一次的動物馬拉松比賽得到第一。', 'Y');
INSERT INTO `team` (`id`, `Porder`, `create_time`, `title`, `subtitle`, `Cover0`, `Content`, `Status`) VALUES
(7, 7, '2018-03-01 02:17:45', '獅王爺', 'BOSS', 'data:image/jpeg;base64,', '雖然年紀有點歲數，但成熟穩重和他一點都搭不上邊，笑點無敵低又愛作夢，常會不小心蹦出一些鬼點子；神出鬼沒的他，酒量深不可測，風流倜儻迷倒了不少少女們，果真不是小人物。', 'Y'),
(8, 8, '2018-03-02 01:18:43', 'GD', '幕後金主', 'data:image/jpeg;base64,', '樂天衝動派隱藏版人物，不經常露臉，人脈很廣愛交朋友，也超級會social，一出現總會大方請客，看似凶狠的外表，其實很溫馴，但喝醉會發瘋就是了...', 'Y');

